Cast:
Alexis

Tue August 10, 2010
It was a wild night for some and even wilder if you made it into the the first VIP party with our specially selected members. It was a great atmosphere with our members and the VIP party people. Everybody had a smile from ear to ear. Our ladies hosted a party to remember, and they put on a show like nothing else. Jmac did his thing, and they could not get enough. I have never heard so many cheers for the money shot. We hope all of our members will stay loyal and cum again to the next party we host.
